import React from 'react';
import { Image, ButtonToolbar, ButtonGroup, Button, FormGroup, FormControl } from 'react-bootstrap';
import neuesSpiel from '../../services/spiele.json';
import ClickEvent from './spielliste';

class ToolBar extends React.Component {
  constructor(props) {
   super(props);
   this.state = {
     isToggleOn: true,
     test: true,
   };

   // This binding is necessary to make `this` work in the callback
   Spielliste.handleNeuesSpielClick = Spielliste.handleNeuesSpielClick.bind(Spielliste);
 }

  render() {
    return (
      <div class="btn-toolbar justify-content-between">
        <button onClick={Spielliste.handleNeuesSpielClick} type="button" class="btn btn-outline-secondary">Neues Spiel</button>
        <div>
          {this.state.isToggleOn ? 'ON' : 'OFF'}
        </div>
          <form>
            <FormGroup>
              <FormControl
                type="text"
                placeholder="Suche"
              />
            </FormGroup>
          </form>
      </div>

    );
  }
}

export default ToolBar;
